import Nav from "../components/Nav";
import styled from "styled-components";

const BG = styled.div`
  position: fixed;
  top: 0;
  right: 0;
  width: 50vw;
  height: 100%;
  background-color: var(--dark-gray);
  z-index: -2;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const BGLine1 = styled.div`
  width: calc(100%-220px);
  height: auto;
  margin-top: 220px;
  margin-bottom: 100px;

  border: solid 2px var(--gray);
  background-color: transparent;

  z-index: -1;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const BGLine2 = styled(BGLine1)`
  margin: 0;
  width: 95%;
  height: 95%;
`;

function Simulator() {
  return (
    <div>
      <BG>
        <BGLine1>
          {" "}
          <BGLine2 />
        </BGLine1>
      </BG>
      <Nav />
    </div>
  );
}

export default Simulator;
